import React, { useState, useCallback } from "react";

export default function TestUseCallback() {
    const [count, setCount] = useState(0);

    // دالة عادية (يتم إنشاؤها مع كل إعادة عرض)
    const normalFunction = () => {
        console.log("تم إنشاء الدالة العادية من جديد!");
    };

    // دالة ميمورية باستخدام useCallback (لا يتم إنشاؤها مع كل إعادة عرض)
    const memoizedFunction = useCallback(() => {
        console.log("تمت إعادة استخدام الدالة الميمورية!");
    }, []);

    return (
        <div>
            <h1>Count: {count}</h1>
            <button onClick={() => setCount(count + 1)}>زيادة العداد</button>

            <button onClick={normalFunction}>دالة عادية</button>
            <button onClick={memoizedFunction}>دالة ميمورية</button>
        </div>
    );
}
